window.bookSummaryJSON = "<p>From <i>USA Today</i> and Amazon Charts best-selling author Meghan Quinn comes a new fake dating, standalone sports romance featuring the hockey men you can’t get enough of and love. This steamy, age-gap romantic comedy will bring all the laughs while making your cheeks blush at the same time.</p> <p>Running into your ex is never ideal.</p> <p>Running into your ex who is now dating your nemesis is a literal nightmare.</p> <p>That’s how I found myself in a sheer panic, reaching for the closest guy at the bar and kissing him. And to my delight he was easily the most attractive man I’ve ever seen.</p> <p>The only problem is, when I tried to walk away after thanking him for his help, he stopped me with three life-changing words....</p> <p>“You owe me.”</p> <p>That’s how I found myself, a college girl, in a fake relationship with a professional hockey player ten years older than <a href=\"http://me.at/\">me.</a></p> <p><a href=\"http://me.at/\">At</a> first it was easy.</p> <p>He helped me with my internship.</p> <p>I helped keep his ex away from him.</p> <p>We were becoming fast <a href=\"http://friends.it/\">friends.</a></p> <p><a href=\"http://friends.it/\">It</a> wasn’t until he started staying the night at my dorm did the rules of our arrangement become <a href=\"http://complicated.now/\">complicated.</a></p> <p><a href=\"http://complicated.now/\">Now</a> my feelings are involved and even though I kissed the right man at the right time, I’m worried he’s just waiting for the clock to run out.</p>"; 
